import React from "react";
import './Dog.css'
import { Link} from 'react-router-dom';





const Dog = (dog)=>{

    if (!dog) {
        return <Link to="/"/>
    } 



    return (
      <div className="Dog">

          <img src={dog.src} alt={dog.name} />
          <div className="DogInfo">
             <p><Link to={`/dogs/${dog.name}`}>{dog.name}</Link> is {dog.age} years old!</p>




        </div>
        <div className="facts">
          Click here for {dog.name}'s detail!

          ))}


        </div>
      </div>
    );
}

export default Dog;
